#
# TABLE STRUCTURE FOR: EMPRESA
#

DROP TABLE IF EXISTS `EMPRESA`;

CREATE TABLE `EMPRESA` (
  `CIF` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_EMPLEADOS` decimal(4,0) unsigned DEFAULT NULL,
  `ALCANCE` enum('Local','Regional','Nacional','Comunitaria','Multinacional') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIPO_EMPRESA` enum('Limitada','Anónima','Cooperativa','Autónomo') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`CIF`),
  UNIQUE KEY `ID_CLIENTE` (`ID_CLIENTE`),
  CONSTRAINT `EMPRESA_ibfk_1` FOREIGN KEY (`ID_CLIENTE`) REFERENCES `CLIENTE` (`ID_CLIENTE`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



